import './Menu_item.css';

const menuData = [
    { title: 'home', iconColor: 'red' },
    { title: 'home', iconColor: 'red' },
    { title: 'home', iconColor: 'red' },
    { title: 'home', iconColor: 'red' },
    { title: 'home', iconColor: 'red' }
]
function MenuItem() {
    return (
        <li className='item'><span className='icon_wrapper'></span><span>Home</span></li>
    )
}
export default MenuItem;
